   // Poor internet connection - use default globe image, TODO: should be removed\n          imageryProvider : Cesium.createTileMapServiceImageryProvider({\n            url : Cesium.buildModuleUrl('Assets/Textures/NaturalEarthII')\n          }),\n          baseLayerPicker : false,\n          geocoder : false\n        });\n    }\n    \n    return viewer;\n  }\n}\n\n    \n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"injectables/ViewersManagerService.html":{"url":"injectables/ViewersManagerService.html","title":"injectable - ViewersManagerService","body":"\n                   \n\n\n\n\n\n\n\n  Injectables\n  ViewersManagerService\n\n\n\n    \n        Info\n    \n\n\n    \n        Source\n    \n\n\n\n    \n        \n            File\n        \n        \n            src/services/viewers-service/viewers-manager.service.ts\n        \n\n\n\n            \n                Index\n                \n                    \n                        \n                            \n                                Properties\n                            \n                        \n                        \n                            \n                                \n                                    \n                                        Private _viewersMap\n                                    \n                                    \n                                        Private defaultIdCounter\n                                    \n                                \n                            \n                        \n                        \n                            \n                                Methods\n                            \n                        \n                        \n                            \n                                \n                                    \n                                        Private generateDefaultId\n                 